import React from 'react';
import './App.css';
import {IconHolberton} from './IconHolberton';
import {UserStudent} from './UserStudent';
import {UserPartner} from './UserPartner';
import {UserAdmin} from './UserAdmin';

function App() {
  return (
    <React.Fragment>
      <IconHolberton/>
      <UserStudent/>
      <UserPartner/>
      <UserAdmin/>
    </React.Fragment>
  );
}

export default App;
